Function NewTCBrowser(strURL)
Set oIE = CreateObject("InternetExplorer.Application") 
oIE.AddressBar = False
oIE.MenuBar = False
oIE.StatusBar = False   
oIE.ToolBar = False
oIE.Width = 500
oIE.Height = 500

oIE.Navigate strURL
oIE.Visible = true
End Function
